import React from "react";
import "../css/akademii.css";
import data from "../akademii.json";
const AkademiiCards = () => {
  return (
    <div className="academii-crds">
      {data.map((card) => (
        <div
          className="card"
          style={{
            backgroundImage: `url(${card.image})`,
            backgroundPosition: "center",
            backgroundSize: "cover",
          }}
        >
          <div style={{ backgroundColor: `rgba(${card.bcolor})`,
        width: "100%",
        height: "100%" }}>
            <h1>{card.title}</h1>
            <p>{card.mesta}</p>
            <p>{card.upisi}</p>
            <p>{card.postani}</p>
            <p>{card.partneri}</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default AkademiiCards;
